function ToggleShopItem(n,t){$.get("/ShoppingLists/ToggleShopItem?product_id="+n+"&unitString="+t,function(){divId="ShopItem-"+n+t;className="shopItemBought";console.log("Toggle: "+divId);var i=document.getElementById(divId);i.classList.contains(className)?(console.log("Remove: "+divId),i.classList.remove(className)):(console.log("Add: "+divId),i.classList.add(className))})}